import React, { Component } from "react";
import IntroText from "../components/IntroText3";

export default class Intro extends Component {
  getInitialState() {
    let state = {};
    React.Children.forEach(this.props.children, (child, index) => {
      state[index] = false;
    });
    return state;
  }
  render() {
    return (
      <div>
        <IntroText />
      </div>
    );
  }
}
